package net.onlineshop.services.manage.product.bean;import java.io.Serializable;/** * 商品 *  *  *  */public class SellInfo implements Serializable {	public SellInfo() {	}	private String productName;	private String totalSell;	private Integer countOrder;	public String getProductName() {		return productName;	}	public void setProductName(String productName) {		this.productName = productName;	}	public String getTotalSell() {		return totalSell;	}	public void setTotalSell(String totalSell) {		this.totalSell = totalSell;	}	public Integer getCountOrder() {		return countOrder;	}	public void setCountOrder(Integer countOrder) {		this.countOrder = countOrder;	}}